import React, { Component } from "react";
import "../css/App.css";
import ApiService from "../service/ApiService";
import { Redirect } from "react-router-dom";
import {
  SESSION_STORAGE_TOKEN,
  SESSION_STORAGE_USERNAME
} from "../constants/Constants";
import "../css/App.css";

class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {
      firstName: "",
      lastName: "",
      email: "",
      redirect: false
    };
  }
  logoutHandler = e => {
    sessionStorage.removeItem(SESSION_STORAGE_TOKEN);
    sessionStorage.removeItem(SESSION_STORAGE_USERNAME);
    this.setState({
      firstName: "",
      lastName: "",
      email: "",
      redirect: true
    });
  };

  componentDidMount() {
    if (
      sessionStorage.getItem(SESSION_STORAGE_TOKEN) &&
      sessionStorage.getItem(SESSION_STORAGE_USERNAME)
    ) {
      const token = sessionStorage.getItem(SESSION_STORAGE_TOKEN);
      const data = sessionStorage.getItem(SESSION_STORAGE_USERNAME);

      console.log("username:", data);
      console.log("token", token);

      ApiService.getParentData(data).then(response => {
        this.setState({
          firstName: response.data.firstName,
          lastName: response.data.lastName,
          email: response.data.email
        });
      });
    } else {
      this.setState({ redirect: true });
    }
  }
  render() {
    if (this.state.redirect) {
      return <Redirect to={"/"} />;
    }
    return (
      <div>
        <section className="section pt-4 pb-4 osahan-account-page">
          <div className="container">
            <div className="row">
              <div className="col-md-3">
                <div className="osahan-account-page-left shadow-sm bg-white h-100">
                  <div className="border-bottom p-4">
                    <div className="osahan-user text-center">
                      <div className="osahan-user-media">
                        <img
                          className="mb-3 rounded-pill shadow-sm mt-1"
                          src=""
                          alt={this.state.firstName}
                        />
                        <div className="osahan-user-media-body">
                          <h6 className="mb-2">{this.state.firstName}</h6>
                          <p className="mb-1">{this.state.lastName}</p>
                          <p>{this.state.email}</p>
                          <p className="mb-0 text-black font-weight-bold">
                            <a
                              className="text-primary mr-3"
                              data-toggle="modal"
                              data-target="#edit-profile-modal"
                              href="#"
                            >
                              <i className="icofont-ui-edit" /> EDIT
                            </a>
                          </p>
                        </div>
                      </div>
                    </div>
                  </div>
                  <ul
                    class="nav nav-tabs flex-column border-0 pt-4 pl-4 pb-4"
                    id="myTab"
                    role="tablist"
                  >
                    <li class="nav-item">
                      <a
                        class="nav-link active"
                        id="orders-tab"
                        data-toggle="tab"
                        href="#orders"
                        role="tab"
                        aria-controls="orders"
                        aria-selected="true"
                      >
                        <i class="icofont-food-cart" /> Orders
                      </a>
                    </li>
                    <li class="nav-item">
                      <a
                        class="nav-link"
                        id="offers-tab"
                        data-toggle="tab"
                        href="#offers"
                        role="tab"
                        aria-controls="offers"
                        aria-selected="false"
                      >
                        <i class="icofont-sale-discount" /> Offers
                      </a>
                    </li>
                    <li class="nav-item">
                      <a
                        class="nav-link"
                        id="favourites-tab"
                        data-toggle="tab"
                        href="#favourites"
                        role="tab"
                        aria-controls="favourites"
                        aria-selected="false"
                      >
                        <i class="icofont-heart" /> Favourites
                      </a>
                    </li>
                    <li class="nav-item">
                      <a
                        class="nav-link"
                        id="payments-tab"
                        data-toggle="tab"
                        href="#payments"
                        role="tab"
                        aria-controls="payments"
                        aria-selected="false"
                      >
                        <i class="icofont-credit-card" /> Payments
                      </a>
                    </li>
                    <li class="nav-item">
                      <a
                        class="nav-link"
                        id="addresses-tab"
                        data-toggle="tab"
                        href="#addresses"
                        role="tab"
                        aria-controls="addresses"
                        aria-selected="false"
                      >
                        <i class="icofont-location-pin" /> Addresses
                      </a>
                    </li>
                  </ul>
                </div>
              </div>
            </div>
          </div>
        </section>

        <section className="breadcrumb-osahan pt-5 pb-5 bg-light position-relative text-center">
          <h1 className="text-white">Dashboard</h1>
          <h6 className="text-white-50">Dasbboard</h6>
          <h1>
            {this.state.firstName} {this.state.lastName}{" "}
          </h1>

          <button onClick={this.logoutHandler}>Logout</button>
        </section>
      </div>
    );
  }
}

export default Dashboard;
